import React, { useState } from "react";

import MenuIcon from "@mui/icons-material/Menu";
import { Button } from "../Button/Button";
import Avatar from "../Images/Avatar.png";
import Box from "../Images/box.png";

import classes from "./styles.module.css";

const pages = ["About", "How it works", "Blog", "Contacts"];
const settings = ["Profile", "Account", "Dashboard", "Logout"];

const Navbar = () => {
  const [showMenu, setShowMenu] = useState(false);
  const onClick = () => {
    alert("Click");
  };
  return (
    <div className={classes.container}>
      <div className={classes.menuBtn} onClick={() => setShowMenu(!showMenu)}>
        <MenuIcon />
      </div>
      <div>
        <div className={classes.linkBigScreen}>
          {pages.map((page) => (
            <span key={page} className={classes.chooseLink}>
              {page}
            </span>
          ))}
        </div>
        {showMenu && (
          <>
            {pages.map((page) => (
              <span key={page} className={classes.chooseLink}>
                {page}
              </span>
            ))}
            <div className={classes.menuBtn}>
              <Button
                imgContent={Avatar}
                backgroundParam="#FCFCF0"
                paddingParam="16px"
                boxShadowParam="6px 6px #2D2A26"
                colorBackBtn="#2D2A26"
                onClick={onClick}
              ></Button>
            </div>
          </>
        )}
      </div>
      <div className={classes.groupBtn}>
        <Button
          title="Get a Kit"
          imgContent={Box}
          backgroundParam="#FCFCF0"
          paddingParam="16px 27px"
          boxShadowParam="6px 6px #2D2A26"
          colorBackBtn="#2D2A26"
          paddingForImg="9px"
          onClick={onClick}
        ></Button>
        <div className={classes.avatarBtn}>
          <Button
            imgContent={Avatar}
            backgroundParam="#FCFCF0"
            paddingParam="16px"
            boxShadowParam="6px 6px #2D2A26"
            colorBackBtn="#2D2A26"
            onClick={onClick}
          ></Button>
        </div>
      </div>
    </div>
  );
};
export default Navbar;
